script: |
  super -f text -I q13378.spq | sort > q13378.out

inputs:
  - name: q13378.spq
    data: |
      SELECT ALL - col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col1 * - - col2 NOT BETWEEN + col1 AND + - col1 * - + 14;
  - name: tab1

outputs:
  - name: q13378.out
    data: |
      -14
      -47
      -5
